webpackJsonp([17],{"./node_modules/json-loader/index.js!./.cache/json/week-17-17.json":function(e,t){e.exports={data:{site:{siteMetadata:{title:"Jeffry.in",author:"Jeff Wainwright"}},markdownRemark:{id:"/Users/jwainwright/Dropbox/me/git-docs/yowainwright.github.io/src/pages/2017-05-07-week-17-17/index.md absPath of file >>> MarkdownRemark",html:'<p>While skateboarding hard during my young adult life, my ankles were not treated the best. Now, well into my thirties, I sometimes have extended ankle problems after minor injuries—like stubbing my foot. This happened this week so I wasn’t able to do much exercise. At work, I built an observer to try to fix a race condition we’ve been dealing with in our analytics tool since before I started. Today, Sunday, my ankle felt good enough that I could go on a long walk and I did—in the snow, just above Los Angeles.</p>\n<figure>\n  <img src="//yowainwright.imgix.net/wk-17/portrait.jpg?w=800&h=800&crop=focalpoint&auto=format" alt="Ruby Beach" />\n</figure>',frontmatter:{title:"Week 17, dealing with an ankle injury and using an observer and/or a mediator pattern",date:"May 07, 2017"}}},pathContext:{path:"/week-17-17/"}}}});
